const Navbar = () => {
    return(
        <nav class="bg-red-900 relative">
          <h1 class="text-3xl font-extrabold m-2">ZETARIORS</h1>
            <div class="container">
              <ul class="flex right-0 border-4 enter">
                <li class="text-white border-4 border-black m-2"><a href="#">Home</a></li>
                <li class="text-white border-4 border-black m-2"><a href="#">Gallery</a></li>
                <li class="text-white border-4 border-black m-2"><a href="#">Contact</a></li>
              </ul>
            </div>
        </nav>
    )
}



export default Navbar;
